import { useState } from 'react';
import Layout from '../../components/Layout';
import Date_FreeText from '../../components/Date_FreeText';
import Date_Calendar from '../../components/Date_Calendar';

export default () => {
	const [whichSection, setWhichSection] = useState(false);

	const y = () => {
		setWhichSection(!whichSection)
	};

	return (
		<Layout>
			<br />
			<br />
			<p className="title has-text-link has-text-centered has-text-weight-normal">Schedule a meetings</p>
			<div className="columns has-text-centered">
				<div className="column"></div>
				<div className="column is-4 has-background-white-ter">
					<a className="btn" onClick={y}>
						calendar
					</a>
				</div>
				<div className="column is-4 has-background-white-ter">
					<a className="btn" onClick={y}>
						free text
					</a>
				</div>
				<div className="column"></div>
			</div>
			<p>{x}</p>
			<div>{x ? <Date_Calendar /> : <Date_FreeText />}</div>
		</Layout>
	);
};
